JavaScript's built-in `sort()` method can be used to sort arrays. We can use this method and provide a custom comparison function to achieve case-insensitive sorting.

## Step 3: Create a custom comparison function
The comparison function should convert both strings to lowercase or uppercase before comparing them. This ensures that the sorting is case-insensitive.

## Step 4: Implement the sorting
We can use the `sort()` method and provide the custom comparison function to sort the array.

## Step 5: Test the solution
Let's test the solution with an example array.

```javascript
// Define the array to be sorted
let arr = ["Zebra", "apple", "Cat", "dog", "Elephant"];

// Sort the array in a case-insensitive manner
