You can use the `readline` module in Node.js to get user input in TypeScript. Here's an example:

```typescript
import * as readline from 'readline';

const rl = readline.createInterface({
  input: process.stdin,
  output: process.stdout
});

rl.question('Please enter your name: ', (answer) => {
  console.log(`Hello, ${answer}!`);
  rl.close();
});
```

In this example, we create a `readline` interface and use the `question` method to prompt the user to enter their name. The `question` method takes two arguments: the prompt string and a callback function that will be called with the user's response.

If you want to get multiple inputs from the user, you can use a loop:

```typescript
import * as readline from 'readline';

const rl = readline.createInterface({
  input: process.stdin,
  output: process.stdout
});

let name: string;
let age: number;

rl.question('Please enter your name: ', (answer) => {
  name = answer;
  rl.question('Please enter your age: ', (answer) => {
    age = parseInt(answer);
    console.log(`Hello, ${name}! You are ${age} years old.`);
    rl.close();
  });
});
```

In this example, we use nested `question` calls to get the user's name and age.

